export const TakeSurvey=(props)=>{
  console.log(props.qbank);
  return(
    <>
    {
      props.qbank.map((ele)=>{
        <h2>{ele.question}</h2>
        ele.options.map((opt)=>{
        <p>{opt.value}</p>
        })
      })
    }
    <p>I am working</p>
    </>
  )
}
